import React from 'react';
import Filter from './Filter';
import '../stylesheets/Filter.scss';

class Header extends React.Component {
  render() {
    return (
      <header>
        <h1>Shows</h1>
        <Filter />
      </header>
    );
  }
}

export default Filter;
